measurements.description:
Nine flowers and two buds on one 96-cm inflorescence;


 sepals white overlaid light green, burgundy spots and stripes, burgundy blush marginally; 
 petals white, overlaid light green, burgundy stripes, blushed burgundy marginally;
 lip margin ruffled, white, blotched burgundy along edges, central burgundy stripe;

 column white, blushed burgundy, burgundy stripes ventrally, anther cap white; substance firm; texture matte.
